            "content": "\u003cp\u003e\u003ca href\u003d\"http://lovelypackage.com/wp-content/uploads/2012/10/lovely-package-colorfall-1.jpg\" rel\u003d\"lightbox[29193]\"\u003e\u003cimg title\u003d\"lovely-package-colorfall-1\" src\u003d\"http://lovelypackage.com/wp-content/uploads/2012/10/lovely-package-colorfall-1-e1350704600542.jpg\" alt\u003d\"\" width\u003d\"538\" height\u003d\"413\"\u003e\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003eDesigned by \u003ca href\u003d\"http://www.marblesthebrainstore.com/\"\u003eMarbles: Brain Workshop\u003c/a\u003e | Country: United States\u003c/p\u003e\n\u003cp\u003e\u003cem\u003e“At Marbles: The Brain Store, we believe there’s an almost innate sense of satisfaction that comes from setting up dominoes into elaborate design, then knocking them down and listening to their gentle click-clack sound.  And that’s all fine and dandy, don’t misunderstand. But where’s the color?  Where’s the whimsy? Where’s the ability to create striking images based on design cards or random ideas you have floating around in your noggin They’re all right here in Colorfall!\u003c/em\u003e\u003c/p\u003e\n\u003cp\u003e\u003cem\u003eOur product itself was designed by Chrissy Quinlan and Brad Hoffman, after winning a product design contest held at their university. The box was a collaboration of much hard work on behalf of the Marbles: Brain Workshop team (a division of Marbles: The Brain Store). There were many changes and shapes before the box could become something mass produceable, but the whole time we aimed high to create a box that reflected the fun inside: bright colors, just enough cheeky quotes, and lots of knocking down of tiles!”\u003c/em\u003e\u003c/p\u003e\n\u003cp\u003e\u003cspan\u003e\u003c/span\u003e\u003ca href\u003d\"http://lovelypackage.com/wp-content/uploads/2012/10/lovely-package-colorfall-2.jpg\" rel\u003d\"lightbox[29193]\"\u003e\u003cimg title\u003d\"lovely-package-colorfall-2\" src\u003d\"http://lovelypackage.com/wp-content/uploads/2012/10/lovely-package-colorfall-2-e1350705139773.jpg\" alt\u003d\"\" width\u003d\"538\" height\u003d\"358\"\u003e\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href\u003d\"http://lovelypackage.com/wp-content/uploads/2012/10/lovely-package-colorfall-3.jpg\" rel\u003d\"lightbox[29193]\"\u003e\u003cimg title\u003d\"lovely-package-colorfall-3\" src\u003d\"http://lovelypackage.com/wp-content/uploads/2012/10/lovely-package-colorfall-3-e1350705219616.jpg\" alt\u003d\"\" width\u003d\"538\" height\u003d\"358\"\u003e\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href\u003d\"http://lovelypackage.com/wp-content/uploads/2012/10/lovely-package-colorfall-4.jpg\" rel\u003d\"lightbox[29193]\"\u003e\u003cimg title\u003d\"lovely-package-colorfall-4\" src\u003d\"http://lovelypackage.com/wp-content/uploads/2012/10/lovely-package-colorfall-4-e1350705251848.jpg\" alt\u003d\"\" width\u003d\"538\" height\u003d\"460\"\u003e\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href\u003d\"http://lovelypackage.com/wp-content/uploads/2012/10/lovely-package-colorfall-5.jpg\" rel\u003d\"lightbox[29193]\"\u003e\u003cimg title\u003d\"lovely-package-colorfall-5\" src\u003d\"http://lovelypackage.com/wp-content/uploads/2012/10/lovely-package-colorfall-5-e1350705287342.jpg\" alt\u003d\"\" width\u003d\"538\" height\u003d\"487\"\u003e\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href\u003d\"http://lovelypackage.com/wp-content/uploads/2012/10/lovely-package-colorfall-6.jpg\" rel\u003d\"lightbox[29193]\"\u003e\u003cimg title\u003d\"lovely-package-colorfall-6\" src\u003d\"http://lovelypackage.com/wp-content/uploads/2012/10/lovely-package-colorfall-6-e1350705304752.jpg\" alt\u003d\"\" width\u003d\"538\" height\u003d\"428\"\u003e\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href\u003d\"http://lovelypackage.com/wp-content/uploads/2012/10/lovely-package-colorfall-7.png\" rel\u003d\"lightbox[29193]\"\u003e\u003cimg title\u003d\"lovely-package-colorfall-7\" src\u003d\"http://lovelypackage.com/wp-content/uploads/2012/10/lovely-package-colorfall-7-e1350705331239.png\" alt\u003d\"\" width\u003d\"538\" height\u003d\"358\"\u003e\u003c/a\u003e\u003c/p\u003e"
