        "id": "tag:google.com,2005:reader/item/334ea1d30ecd99ea",
        "categories": ["user/13028453139652463024/state/com.google/read", "user/13028453139652463024/label/DESIGN", "user/13028453139652463024/state/com.google/reading-list", "user/13028453139652463024/state/com.google/fresh", "Health \u0026 Beauty", "Bottle", "Box", "Health", "Health Basics", "Label", "Milk", "New Zealand", "Package", "Package Design", "packaging", "Shampoo", "Soap"],
        "title": "Health Basics",
        "published": 1350151999,
        "updated": 1350151999,
        "alternate": [{
            "href": "http://lovelypackage.com/health-basics/",
            "type": "text/html"
        }],
        "content": {
            "direction": "ltr",
            "content": "\u003cp\u003e\u003ca href\u003d\"http://lovelypackage.com/wp-content/uploads/2012/10/lovely-package-health-basics-1.jpg\" rel\u003d\"lightbox[29034]\"\u003e\u003cimg title\u003d\"lovely-package-health-basics-1\" src\u003d\"http://lovelypackage.com/wp-content/uploads/2012/10/lovely-package-health-basics-1-e1349499347537.jpg\" alt\u003d\"\" width\u003d\"538\" height\u003d\"538\"\u003e\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003eDesigned by \u003ca href\u003d\"http://www.milk.co.nz/\"\u003eMilk\u003c/a\u003e | Country: New Zealand\u003c/p\u003e\n\u003cp\u003e\u003cem\u003e“The New Zealand story is not a new one to consumers, but it’s a compelling and evocative differential in a category heavily crowded by imported brands. Health Basics wanted to own that share of shelf, heart and mind by leveraging their authentically New Zealand made provenance.\u003c/em\u003e\u003c/p\u003e\n\u003cp\u003e\u003cem\u003eWe were happy to oblige.”\u003c/em\u003e\u003c/p\u003e\n\u003cp\u003e\u003cspan\u003e\u003c/span\u003e\u003ca href\u003d\"http://lovelypackage.com/wp-content/uploads/2012/10/lovely-package-health-basics-2.jpg\" rel\u003d\"lightbox[29034]\"\u003e\u003cimg title\u003d\"lovely-package-health-basics-2\" src\u003d\"http://lovelypackage.com/wp-content/uploads/2012/10/lovely-package-health-basics-2-e1349499449744.jpg\" alt\u003d\"\" width\u003d\"538\" height\u003d\"583\"\u003e\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href\u003d\"http://lovelypackage.com/wp-content/uploads/2012/10/lovely-package-health-basics-3.jpg\" rel\u003d\"lightbox[29034]\"\u003e\u003cimg title\u003d\"lovely-package-health-basics-3\" src\u003d\"http://lovelypackage.com/wp-content/uploads/2012/10/lovely-package-health-basics-3-e1349499926764.jpg\" alt\u003d\"\" width\u003d\"538\" height\u003d\"307\"\u003e\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href\u003d\"http://lovelypackage.com/wp-content/uploads/2012/10/lovely-package-health-basics-4.jpg\" rel\u003d\"lightbox[29034]\"\u003e\u003cimg title\u003d\"lovely-package-health-basics-4\" src\u003d\"http://lovelypackage.com/wp-content/uploads/2012/10/lovely-package-health-basics-4-e1349499950763.jpg\" alt\u003d\"\" width\u003d\"538\" height\u003d\"418\"\u003e\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href\u003d\"http://lovelypackage.com/wp-content/uploads/2012/10/lovely-package-health-basics-5.jpg\" rel\u003d\"lightbox[29034]\"\u003e\u003cimg title\u003d\"lovely-package-health-basics-5\" src\u003d\"http://lovelypackage.com/wp-content/uploads/2012/10/lovely-package-health-basics-5-e1349499973952.jpg\" alt\u003d\"\" width\u003d\"538\" height\u003d\"307\"\u003e\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003cem\u003e“Milk started with a new proposition for the brand and overt references to the evocative places and experiences that truly resonate with New Zealand consumers.”\u003c/em\u003e\u003c/p\u003e\n\u003cp\u003e\u003cem\u003eOur recommendations included a move away from exotic Aloe to the use of indigenous Harakeke as a foundation moisturising ingredient. We directed a rockstar industrial design team to produce a strong pack family with a simplified and honest pack aesthetic. We also developed a uniform design and packaging language which included the disruptive re-take on the soap on the rope, along with a removable label on hand soap containers for a more sympathetic fit in domestic bathrooms.”\u003c/em\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href\u003d\"http://lovelypackage.com/wp-content/uploads/2012/10/lovely-package-health-basics-6.jpg\" rel\u003d\"lightbox[29034]\"\u003e\u003cimg title\u003d\"lovely-package-health-basics-6\" src\u003d\"http://lovelypackage.com/wp-content/uploads/2012/10/lovely-package-health-basics-6-e1349500029907.jpg\" alt\u003d\"\" width\u003d\"538\" height\u003d\"729\"\u003e\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca href\u003d\"http://lovelypackage.com/wp-content/uploads/2012/10/lovely-package-health-basics-7.jpg\" rel\u003d\"lightbox[29034]\"\u003e\u003cimg title\u003d\"lovely-package-health-basics-7\" src\u003d\"http://lovelypackage.com/wp-content/uploads/2012/10/lovely-package-health-basics-7-e1349500048966.jpg\" alt\u003d\"\" width\u003d\"538\" height\u003d\"729\"\u003e\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003cem\u003e“So what else did we do? What didn’t we do; an evolved visual identity with new symbol and custom typeface, visual language, design system, new brand story, new core brand proposition, individual product naming, product design for packaging, packaging language and back label stories, web and associated collaterals.”\u003c/em\u003e\u003c/p\u003e"
        },
